import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Open the mobile menu by clicking the "All" button
    // Using a selector that targets the specific div with the text "All"
    const menuTrigger = page.locator('div.nav-menu:has-text("All")');
    await menuTrigger.waitFor({ state: 'visible' });
    await menuTrigger.click();

    // 2. Verify the mobile menu is visible
    const mobileMenuOverlay = page.locator('#mobileMenuOverlay');
    await mobileMenuOverlay.waitFor({ state: 'visible' });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_menu_open.png'));

    // 3. Click on the "Electronics" link inside the mobile menu
    // Scoping the locator to within the mobile menu to avoid ambiguity
    const electronicsLink = page.locator('.mobile-menu a:has-text("Electronics")').first();
    await electronicsLink.waitFor({ state: 'visible' });
    await electronicsLink.click();

    // 4. Verify that the content has changed to the "Electronics" category
    // The JS code should update the main content with a heading for the category
    const categoryHeadingLocator = page.locator('h2:has-text("Electronics")');
    await categoryHeadingLocator.waitFor({ state: 'visible' });
    const extractedData = {
      categoryTitle: await categoryHeadingLocator.textContent()
    };
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics_category.png'));

    // 5. Close the mobile menu using the close button
    // The menu is still open, so we need to find the close button within it
    const closeButton = page.locator('.mobile-menu .close-mobile-menu');
    await closeButton.waitFor({ state: 'visible' });
    await closeButton.click();

    // 6. Verify the mobile menu is hidden
    await mobileMenuOverlay.waitFor({ state: 'hidden' });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_menu_closed.png'));

    return {
      success: true,
      action: "Successfully opened, navigated, and closed the mobile menu.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
